import React, { Component } from "react";
import ReactDOM from "react-dom";
import "./App.css";

const Navbar = () => {
  return (
    <nav>
      <ul>
        <li>
          <a href="#">Home</a>
        </li>
        <li>
          <a href="#">Rooms</a>
        </li>
        <li>
          <a href="#">Photo Gallery</a>
        </li>
        <li>
          <a href="#">Location & Directions</a>
        </li>
        <li>
          <a href="#">Near & Around Us</a>
        </li>
        <li>
          <a href="#">Contact Us</a>
        </li>
      </ul>
    </nav>
  );
};

const Main = () => {
  return (
    <main>
      <h1>Welcome to our motel!</h1>
      <p>
        We offer a variety of rooms to choose from, all with their own unique
        features. We also have a photo gallery where you can see pictures of our
        rooms and our property.
      </p>
      <p>If you have any questions, please don't hesitate to contact us.</p>
    </main>
  );
};

class App extends Component {
  render() {
    return (
      <div className="App">
        <Navbar />
        <Main />
      </div>
    );
  }
}

ReactDOM.render(<App />, document.getElementById("root"));
